  false,\n\t\"url\": null,\n\t\"notes\": \"This report discusses water quality problems
  related to salinity and trace elements at Stillwater National Wildlife Refuge. Agricultural
  drain water poses a threat to fish and wildlife resources at Stillwater National
  Wildlife Refuge. The Refuge receives agricultural drain waters from the Truckee-Carson
  Irrigation District. Often the drain water has elevated salinity and concentrations
  of trace elements including arsenic, boron, copper, lithium, molybdenum, and strontium.
  USFWS Region 1 appropriated funds to the National Fisheries Contaminant Research
  Center (NFCRC) to conduct research on the toxicity of trace elements and salinities
  found at Stillwater NWR. Studies were conducted with both fresh and salt water organisms.
  The use of both freshwater and saltwater organisms allowed for the separation of
  toxic effects due to salinity from the toxic effects of trace elements. Toxicological
  data generated includes: (1) the importance of ion ratios in addition to trace elements
  on the toxicity of drain waters to aquatic organisms; (2) the increased toxicity
  of mixtures of individual trace elements; and (3) the high toxicity of groundwater
  that enters into Stillwater NWR surface waters. The information in this report is
  preliminary as trace element analyses are in progress.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
